import React from 'react';
import './popUp.css'


class PopUp extends React.Component {
    render() {
        return (
            <div className="container mt-3">
                Do you want to Save the Playlist on your Spotify account?
                <div className="btn-block mt-5">
                    <a className="btn btn-primary mr-4" onClick={this.props.onSave}>Save</a>
                    <a className="btn btn-primary mr-4" onClick={this.props.onChoose}>Not Yet</a>
                </div>
            </div>

        )
    }
}

export default PopUp;
